import styled from "styled-components";

export const Container = styled.body`
    background: #FFFFFF;
`;
export const ButtonLeft = styled.button`
    top: 18px;
    margin-left: 10px;
    left: 10px;
    position: absolute;
    border-radius: 10px;
    border: none;
`;
export const ButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    position: absolute;
    border-radius: 10px;
    top: 18px;
    border: none;
`;
export const Title = styled.h1`
    position: absolute;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    top: 16px;
`;
